sys_variable_value.value:
(function execute(inputs, outputs) {
    var randUtil = GlideSecureRandomUtil;
    if(gs.nil(inputs.bound) || Math.sign(inputs.bound) == -1 || Math.sign(inputs.bound) == 0){
        outputs.random_integer = Math.abs(randUtil.getSecureRandomInt());
    } else {
        outputs.random_integer = randUtil.getSecureRandomIntBound(inputs.bound);
    }
})(inputs, outputs);

